body:
@pabloem 

Thank you for your review.
I will try to add a test case.

I guess in general this falls under https://issues.apache.org/jira/browse/BEAM-92 which @vikkyrk worked on for a while but it was deprioritized.

But while we don't have that API, let's discuss the other options. I think the issue with current approach in the PR - that you can't write same-looking TableRows to different tables - is serious enough that we should not submit it like this.

The other approach is what you suggest - let users map a Foo to TableRow and table name / schema. The addition of schema makes it less tempting to do the table name & schema computation for every Foo. Maybe something like this? (which is similar to some of the approaches we were considering for BEAM-92)

```
foos.apply(BigQueryIO.Write.to(BigQueryIO.Write.TableDispatcher<Foo, ?>))
```

where:

```
interface TableDispatcher<InputT, DestinationT> {
  DestinationT getDestination(InputT element);
  String getTableName(DestinationT destination);
  Schema getTableSchema(DestinationT destination);
  ... maybe other stuff like "create/write disposition" even? ...
  TableRow toTableRow(InputT element);
}
```
